E.g

```typescript

abstract class Exporter {
// define public method signatures here
}

class HTMLExporer extends Exporter {
// define your loose functions as methods in this class e.g.:
protected async createMessageBody() {...}
protected async createHTML() {...}
public async export() {...}
}
```

That way someone in future can come and make

```typescript
class MyCustomExporter extends HTMLExporter {
protected async createMessageBody() {
    // Handle things differently
}
}
```

